import * as React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Switch } from 'react-router-dom'
import dayjs from 'dayjs';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';

class EndDateSelector extends React.Component {
	constructor(props) {
		super(props);
	};

	handleChangeEndDate = newValueEndDate => this.setState({ valueEnd: newValueEndDate });

	render() {
		return (
			<div id="choiceButtons">
				<LocalizationProvider dateAdapter={AdapterDayjs}>
                <DesktopDatePicker
                    label="End Date"
                    inputFormat="MM-DD-YY"
                    value={this.state.valueEnd}
                    onChange={(newValue) => {this.handleChangeEndDate(newValue.format("YYYY-DD-MM"));}}
                    renderInput={(params) => <TextField {...params} />}
                />
				</LocalizationProvider>
			</div>
		);
	}
}
export default EndDateSelector;
